				<div className={styles.container} key={collection.id}>
					<main className={styles.container}>
						<h1>{params.collectionId}</h1>
						<img src={image} className={styles.img} alt={name} />
						<div className={styles.collection_name}>
							<h2>{name}</h2>
							<h3>{headline}</h3>
						</div>
					</main>
					<Link className={styles.btn} to={`/collections/${collection.id}`}>
